INSERT INTO `blog_post` (`blog_post_id`, `english_title`, `french_title`, `english_article`, `french_article`, `blog_category_id`, `banner_image`, `created_by`, `is_active`, `is_popular`, `en_meta_title`, `fr_meta_title`, `en_meta_description`, `fr_meta_description`, `en_meta_keywords`, `fr_meta_keywords`, `en_og_title`, `fr_og_title`, `en_og_description`, `fr_og_description`, `created_at`, `updated_at`, `publish_date`) VALUES
	(3, 'Evive - Cubes de smoothies', 'Evive - Cubes de smoothies', '<p><em>This post is not available in english for the moment.&nbsp;</em></p>\r\n\r\n<p><em>French version below:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>R&eacute;cemment, nous discutions des fa&ccedil;ons d&rsquo;avoir &agrave; la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons d&eacute;couvert la compagnie Evive.</p>\r\n\r\n<p>Cette compagnie produit des cubes de smoothie congel&eacute;es. Il s&rsquo;agit en fait de pur&eacute;e de fruits, de l&eacute;gumes et de super aliments.</p>\r\n\r\n<p><img alt="" height="189" src="https://www.alternateeve.com/upload/redactor_upload_images/1504051766_12027825_1496145894035199_4838804955488600807_n%20copie.jpg" style="float:right" title="" width="190" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Il suffit de prendre une portion de cubes, vous les mettez dans un r&eacute;cipient, vous ajoutez le liquide de votre choix, vous attendez 15-20 min et vous brasser. &nbsp;C&rsquo;est parfait pour les gens press&eacute;s ou pour ceux qui pr&eacute;f&egrave;rent prendre leur petit-d&eacute;jeuner&nbsp;au travail. &nbsp;</p>\r\n\r\n<p>C&rsquo;&eacute;tait la premi&egrave;re fois que nous voyions une id&eacute;e semblable alors que les smoothies sont plut&ocirc;t &agrave; la mode depuis quelques ann&eacute;es. Nous avons donc contact&eacute; l&rsquo;&eacute;quipe d&rsquo;Evive afin qu&rsquo;ils nous parlent de leurs produits et qu&rsquo;ils nous racontent comment l&rsquo;entreprise est n&eacute;e.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="274" src="https://www.alternateeve.com/upload/redactor_upload_images/1504053575_IMG_20170511_120011 copie.jpg" title="" width="205" /></p>\r\n\r\n<p>L&rsquo;id&eacute;e de lancer des smoothies en cubes sur le march&eacute; est venu pendant les ann&eacute;es d&rsquo;universit&eacute; de la fondatrice Claudia Poulin. L&rsquo;alimentation &eacute;tait un sujet tr&egrave;s important pour elle. Elle voulait manger sainement et une des fa&ccedil;on d&rsquo;y arriver &eacute;tait de se faire des smoothies. Avec son conjoint, Dominic Dub&eacute;, ils ont eu l&rsquo;id&eacute;e des cubes afin de partager une fa&ccedil;on rapide de bien s&rsquo;alimenter avec un grand nombre de personnes. Selon eux, leur formule offre aux gens une fa&ccedil;on simple et rapide de bien manger, ce qui leur permet &eacute;galement de profiter de la vie. De l&agrave; provient leur slogan : &ldquo;Evive ta vie/More from life&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Partager leur vision de la sant&eacute; est un &eacute;l&eacute;ment cl&eacute; de leurs id&eacute;es. Les valeurs tel que le bien-&ecirc;tre, le partage et l&rsquo;harmonie ont une place centrale dans leur compagnie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Claudia et Dominic souhaiteraient faire passer le message suivant avec leur compagnie:</p>\r\n\r\n<p>&ldquo;FAST FOOD DOESN&#39;T MEAN JUNK FOOD. Notre produit offre un fa&ccedil;on &quot;fast food&quot;, sans &ecirc;tre n&eacute;faste pour la sant&eacute;, c&#39;est m&ecirc;me b&eacute;n&eacute;fique &ldquo; - Claudia Poulin</p>\r\n\r\n<p><img alt="" height="140" src="https://www.alternateeve.com/upload/redactor_upload_images/1504053647_unnamed copie.jpg" title="" width="212" /></p>\r\n\r\n<p>Les smoothies d&rsquo;Evive sont fait avec des ingr&eacute;dients biologiques. Ils sont pr&eacute;par&eacute;s au Qu&eacute;bec et lorsque possible, la compagnie&nbsp;utilise des produits locaux. &nbsp;Trois recettes de smoothies sont pr&eacute;sentement disponibles : Le guerrier (framboises, fraises, betterave, graines de chia), le touk-touk (mangue, ananas, abricot, noix de coco) et le yogi (banane, &eacute;pinard, poire, kale, graine de chanvre). Des prot&eacute;ines v&eacute;g&eacute;tales ont &eacute;t&eacute; ajout&eacute; &agrave; chacune des recettes &agrave; la demande des clients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En allant sur le site internet de la compagnie&nbsp;<a href="http://www.evivesmoothie.com/" target="_blank">Evive</a>, vous trouverez la liste compl&egrave;te des ingr&eacute;dients et &eacute;galement les points de ventes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bon smoothie!</p>\r\n\r\n<p>&nbsp;</p>', '<p>R&eacute;cemment, nous discutions des fa&ccedil;ons d&rsquo;avoir &agrave; la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons d&eacute;couvert la compagnie Evive.</p>\r\n\r\n<p>Cette compagnie produit des cubes de smoothie congel&eacute;es. Il s&rsquo;agit en fait de pur&eacute;e de fruits, de l&eacute;gumes et de super aliments.</p>\r\n\r\n<p><img alt="" height="189" src="https://www.alternateeve.com/upload/redactor_upload_images/1504051766_12027825_1496145894035199_4838804955488600807_n%20copie.jpg" style="float:right" title="" width="190" /></p>\r\n\r\n<p>Il suffit de prendre une portion de cubes, vous les mettez dans un r&eacute;cipient, vous ajoutez le liquide de votre choix, vous attendez 15-20 min et vous brasser. &nbsp;C&rsquo;est parfait pour les gens press&eacute;s ou pour ceux qui pr&eacute;f&egrave;rent prendre leur petit-d&eacute;jeuner&nbsp;au travail. &nbsp;</p>\r\n\r\n<p>C&rsquo;&eacute;tait la premi&egrave;re fois que nous voyions une id&eacute;e semblable alors que les smoothies sont plut&ocirc;t &agrave; la mode depuis quelques ann&eacute;es. Nous avons donc contact&eacute; l&rsquo;&eacute;quipe d&rsquo;Evive afin qu&rsquo;ils nous parlent de leurs produits et qu&rsquo;ils nous racontent comment l&rsquo;entreprise est n&eacute;e.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="274" src="https://www.alternateeve.com/upload/redactor_upload_images/1504053575_IMG_20170511_120011%20copie.jpg" title="" width="205" /></p>\r\n\r\n<p>L&rsquo;id&eacute;e de lancer des smoothies en cubes sur le march&eacute; est venu pendant les ann&eacute;es d&rsquo;universit&eacute; de la fondatrice Claudia Poulin. L&rsquo;alimentation &eacute;tait un sujet tr&egrave;s important pour elle. Elle voulait manger sainement et une des fa&ccedil;on d&rsquo;y arriver &eacute;tait de se faire des smoothies. Avec son conjoint, Dominic Dub&eacute;, ils ont eu l&rsquo;id&eacute;e des cubes afin de partager une fa&ccedil;on rapide de bien s&rsquo;alimenter avec un grand nombre de personnes. Selon eux, leur formule offre aux gens une fa&ccedil;on simple et rapide de bien manger, ce qui leur permet &eacute;galement de profiter de la vie. De l&agrave; provient leur slogan : &ldquo;Evive ta vie/More from life&rdquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Partager leur vision de la sant&eacute; est un &eacute;l&eacute;ment cl&eacute; de leurs id&eacute;es. Les valeurs tel que le bien-&ecirc;tre, le partage et l&rsquo;harmonie ont une place centrale dans leur compagnie.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Claudia et Dominic souhaiteraient faire passer le message suivant avec leur compagnie:</p>\r\n\r\n<p>&ldquo;FAST FOOD DOESN&#39;T MEAN JUNK FOOD. Notre produit offre un fa&ccedil;on &quot;fast food&quot;, sans &ecirc;tre n&eacute;faste pour la sant&eacute;, c&#39;est m&ecirc;me b&eacute;n&eacute;fique &ldquo; - Claudia Poulin</p>\r\n\r\n<p><img alt="" height="140" src="https://www.alternateeve.com/upload/redactor_upload_images/1504053647_unnamed%20copie.jpg" title="" width="212" /></p>\r\n\r\n<p>Les smoothies d&rsquo;Evive sont fait avec des ingr&eacute;dients biologiques. Ils sont pr&eacute;par&eacute;s au Qu&eacute;bec et lorsque possible, la compagnie&nbsp;utilise des produits locaux. &nbsp;Trois recettes de smoothies sont pr&eacute;sentement disponibles : Le guerrier (framboises, fraises, betterave, graines de chia), le touk-touk (mangue, ananas, abricot, noix de coco) et le yogi (banane, &eacute;pinard, poire, kale, graine de chanvre). Des prot&eacute;ines v&eacute;g&eacute;tales ont &eacute;t&eacute; ajout&eacute; &agrave; chacune des recettes &agrave; la demande des clients.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>En allant sur le site internet de la compagnie&nbsp;<a href="http://www.evivesmoothie.com/" target="_blank">Evive</a>, vous trouverez la liste compl&egrave;te des ingr&eacute;dients et &eacute;galement les points de ventes.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bon smoothie!</p>\r\n\r\n<p>&nbsp;</p>', 5, '2017-12-14-15-49-07-2017-08-30-00-19-33-18268404_1784018018581317_3005372520109564707_n copie.jpg', 2, 1, 1, 'Evive - Cubes de smoothies', 'Evive - Cubes de smoothies', 'Récemment, nous discutions des façons d’avoir à la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons découvert la compagnie Evive.', 'Récemment, nous discutions des façons d’avoir à la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons découvert la compagnie Evive.', 'Evive smoothies', 'Evive smoothies', 'Evive - Cubes de smoothies', 'Evive - Cubes de smoothies', 'Récemment, nous discutions des façons d’avoir à la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons découvert la compagnie Evive.', 'Récemment, nous discutions des façons d’avoir à la fois une bonne alimentation et de gagner du temps le matin. En fouillant sur internet, nous avons découvert la compagnie Evive.', '2017-06-09 03:13:56', '2017-12-15 00:49:07', '2017-07-01'),
	(5, 'Sarah dans la lune - Écodesign mode', 'Sarah dans la lune - Écodesign mode', '<p><em>This post is not available in english for the moment.&nbsp;</em></p>\r\n\r\n<p><em>French version below:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pour notre premier article, nous sommes all&eacute;s &agrave; la rencontre de Sarah dans la lune, alias Sarah Girouard.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:18px"><img alt="" height="318" src="http://142.44.142.26/upload/redactor_upload_images/1503880392_IMG_2072.JPG" title="" width="239" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sur son&nbsp;<a href="https://sarahdanslalune.com/" target="_blank">site internet,</a>&nbsp;la jeune cr&eacute;atrice montr&eacute;alaise vous propose des articles utilitaires et de modes fait avec des cravates recycl&eacute;es qu&rsquo;elle d&eacute;niche dans des friperies. Elle cr&eacute;e des fanny packs, des &eacute;tuis &agrave; maquillage et des noeuds papillons avec ses trouvailles. D&rsquo;ailleurs, elle peut cr&eacute;er jusqu&rsquo;&agrave; quatre items avec une seule cravate!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>L&rsquo;id&eacute;e de cr&eacute;er son entreprise d&rsquo;&eacute;co-design lui est venu en janvier 2016. Rapidement, elle sort sa premi&egrave;re collection au mois de mai suivant. Le recyclage de mat&eacute;riel est r&eacute;ellement le centre de son projet. Les cravates moins jolies servent de doublure et elle se sert de boutons r&eacute;cup&eacute;r&eacute;s sur ses cr&eacute;ations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lorsqu&rsquo;elle pense au futur, Sarah aimerait cr&eacute;er un site internet o&ugrave; les personnes peuvent personnaliser et commander un produit selon les tissus et mat&eacute;riaux disponibles. Elle souhaiterait &eacute;galement agrandir son &eacute;quipe afin d&rsquo;avoir du personnel qui s&rsquo;occuperait du c&ocirc;t&eacute; administratif et de la communication.</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Si votre curiosit&eacute; a &eacute;t&eacute; piqu&eacute;e, vous pouvez trouver les produits de Sarah dans la lune sur son site internet ou &agrave; la boutique L&rsquo;empreinte coop&eacute;rative au vieux Montr&eacute;al sur la rue Saint-Paul. Elle participera &eacute;galement &agrave; &nbsp;la&nbsp;<a href="https://www.facebook.com/events/443885182627548/" target="_blank">&ldquo;Vente priv&eacute;e et soir&eacute;e de personnalisation mode&rdquo;</a><a href="https://www.facebook.com/events/443885182627548/" target="_blank">&nbsp;</a>organis&eacute;e par l&rsquo;Avenue du Mont-Royal le 3 mai prochain &agrave; la boutique Adam &amp; &Egrave;ve o&ugrave; vous pourrez fabriquer des boucles pour cheveux et des noeuds papillons avec elle.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bon magasinage!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align:center">&nbsp;&nbsp;&nbsp;<img alt="" height="294" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_aa.JPG" width="221" />&nbsp;.&nbsp;<img alt="" height="294" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_a.JPG" width="225" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="324" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_14910491_10154120801556588_410466007101138986_n.jpg" title="" width="323" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vous pouvez aussi d&eacute;couvrir ses cr&eacute;ations sur sa page&nbsp;<a href="https://www.facebook.com/sarahdanslalune/" target="_blank">Facebook</a></p>\r\n\r\n<p>&nbsp;</p>', '<p>Pour notre premier article, nous sommes all&eacute;s &agrave; la rencontre de Sarah dans la lune, alias Sarah Girouard.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:18px"><img alt="" height="318" src="http://142.44.142.26/upload/redactor_upload_images/1503880392_IMG_2072.JPG" title="" width="239" /></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Sur son&nbsp;<a href="https://sarahdanslalune.com/" target="_blank">site internet,</a>&nbsp;la jeune cr&eacute;atrice montr&eacute;alaise vous propose des articles utilitaires et de modes fait avec des cravates recycl&eacute;es qu&rsquo;elle d&eacute;niche dans des friperies. Elle cr&eacute;e des fanny packs, des &eacute;tuis &agrave; maquillage et des noeuds papillons avec ses trouvailles. D&rsquo;ailleurs, elle peut cr&eacute;er jusqu&rsquo;&agrave; quatre items avec une seule cravate!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>L&rsquo;id&eacute;e de cr&eacute;er son entreprise d&rsquo;&eacute;co-design lui est venu en janvier 2016. Rapidement, elle sort sa premi&egrave;re collection au mois de mai suivant. Le recyclage de mat&eacute;riel est r&eacute;ellement le centre de son projet. Les cravates moins jolies servent de doublure et elle se sert de boutons r&eacute;cup&eacute;r&eacute;s sur ses cr&eacute;ations.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Lorsqu&rsquo;elle pense au futur, Sarah aimerait cr&eacute;er un site internet o&ugrave; les personnes peuvent personnaliser et commander un produit selon les tissus et mat&eacute;riaux disponibles. Elle souhaiterait &eacute;galement agrandir son &eacute;quipe afin d&rsquo;avoir du personnel qui s&rsquo;occuperait du c&ocirc;t&eacute; administratif et de la communication.</p>\r\n\r\n<p>&nbsp;&nbsp;</p>\r\n\r\n<p>Si votre curiosit&eacute; a &eacute;t&eacute; piqu&eacute;e, vous pouvez trouver les produits de Sarah dans la lune sur son site internet ou &agrave; la boutique L&rsquo;empreinte coop&eacute;rative au vieux Montr&eacute;al sur la rue Saint-Paul. Elle participera &eacute;galement &agrave; &nbsp;la&nbsp;<a href="https://www.facebook.com/events/443885182627548/" target="_blank">&ldquo;Vente priv&eacute;e et soir&eacute;e de personnalisation mode&rdquo;</a><a href="https://www.facebook.com/events/443885182627548/" target="_blank">&nbsp;</a>organis&eacute;e par l&rsquo;Avenue du Mont-Royal le 3 mai prochain &agrave; la boutique Adam &amp; &Egrave;ve o&ugrave; vous pourrez fabriquer des boucles pour cheveux et des noeuds papillons avec elle.</p>\r\n\r\n<p><br />\r\nBon magasinage!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="294" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_IMG_2072.JPG" title="" width="219" />&nbsp;.&nbsp;<img alt="" height="294" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_aa.JPG" width="221" />&nbsp;. <img alt="" height="294" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_a.JPG" width="225" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="324" src="http://142.44.142.26/upload/redactor_upload_images/1503877109_14910491_10154120801556588_410466007101138986_n.jpg" title="" width="323" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Vous pouvez aussi d&eacute;couvrir ses cr&eacute;ations sur sa page&nbsp;<a href="https://www.facebook.com/sarahdanslalune/" target="_blank">Facebook</a></p>\r\n\r\n<p>&nbsp;</p>', 5, '2017-12-14-15-48-58-2017-08-30-01-42-38-1 960x640.jpg', 19, 1, 1, 'Sarah dans la lune - Écodesign mode', 'Sarah dans la lune - Écodesign mode', 'Sarah dans la lune - Écodesign mode', 'Sarah dans la lune - Écodesign mode', 'Sarah dans la lune - Écodesign mode', 'Sarah dans la lune - Écodesign mode', 'Test OG title EN Sarah dans la lune', 'Test OG title FR Sarah dans la lune', 'test OG description Sarah dans la lune EN- Écodesign mode', 'test OG description Sarah dans la lune FR- Écodesign mode', '2017-08-28 08:26:49', '2017-12-15 00:48:58', '2017-06-01'),
	(6, 'Dans le sac', 'Dans le sac', '<p><em>This post is not available in english for the moment.&nbsp;</em></p>\r\n\r\n<p><em>French version below:</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Avec l&rsquo;ouverture r&eacute;cente d&rsquo;&eacute;piceries z&eacute;ro d&eacute;chet &agrave; Montr&eacute;al, on constate un int&eacute;r&ecirc;t au quotidien pour l&rsquo;&eacute;cologie et l&rsquo;anti-gaspillage. Faire ses courses en vrac? &Ccedil;a nous tente, mais &ccedil;a demande quand m&ecirc;me un peu d&rsquo;organisation. &Agrave; ce sujet, on &nbsp;a d&eacute;couvert Dans le sac, une jeune entreprise montr&eacute;alaise qui a eu l&rsquo;id&eacute;e de sacs en coton r&eacute;utilisables. Vraiment pratique pour faire son &eacute;picerie vrac sans prise de t&ecirc;te!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="227" src="https://static.wixstatic.com/media/97fca0_ebe2da736a00433080739bf8f615ee86~mv2.png/v1/fill/w_202,h_185,al_c,usm_0.66_1.00_0.01/97fca0_ebe2da736a00433080739bf8f615ee86~mv2.png" style="float:right" title="" width="248" /></p>\r\n\r\n<h4>Comment &ccedil;a a commenc&eacute;.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C&rsquo;est en s&rsquo;int&eacute;ressant au mouvement z&eacute;ro d&eacute;chet que St&eacute;phanie et Laurie, qui vont souvent&nbsp;acheter du pain en boulangerie, commencent &agrave; utiliser une taie d&rsquo;oreiller pour &eacute;viter l&rsquo;usage d&rsquo;un nouveau sac &agrave; chaque fois. Elles se rendent compte qu&rsquo;il y a un r&eacute;el besoin et cherchent une solution plus esth&eacute;tique. Les deux amies d&eacute;cident alors de coudre leurs propres sacs &agrave; pain r&eacute;utilisables en coton. C&rsquo;est rapidement un succ&egrave;s et les premiers sacs se vendent en quelques jours. Dans le sac est n&eacute;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>&nbsp;</h4>\r\n\r\n<h4>Dans le sac propose un collection de sacs r&eacute;utilisables 100% coton fabriqu&eacute;s &agrave; Montr&eacute;al.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="221" src="https://static.wixstatic.com/media/97fca0_5928cb00775a4294b5b29ec00e21a3af~mv2.png/v1/fill/w_183,h_183,al_c,usm_0.66_1.00_0.01/97fca0_5928cb00775a4294b5b29ec00e21a3af~mv2.png" style="float:left" title="" width="221" />&nbsp;Les sacs sont adapt&eacute;s &agrave; des usages vari&eacute;s; que ce soit le sac &agrave; pain classique pour vos sorties &agrave; la boulangerie, le sac &agrave; baguette (qui permet m&ecirc;me de transporter votre tapis de yoga si jamais !), ou les sacs &agrave; vrac en grand et petit format pour transporter votre &eacute;picerie : fruits, c&eacute;r&eacute;ales, noix, lentilles...&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>En plus d&rsquo;&ecirc;tre multi-usages et faciles &agrave; transporter, on aime particuli&egrave;rement le charme du tissu en coton et le design minimaliste&nbsp;des sacs.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>Et apr&egrave;s ?</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Chez Dans le sac, &ldquo;un simple geste peut faire une grande diff&eacute;rence&rdquo;. Pour la suite, St&eacute;phanie et Laurie veulent continuer d&rsquo;&eacute;largir la gamme de leurs produits et introduire de la nouveaut&eacute;, toujours avec l&rsquo;id&eacute;e de remplacer un objet jetable du quotidien par un autre durable, r&eacute;utilisable et multifonctionnel. De notre c&ocirc;t&eacute;, on compte bien suivre &ccedil;a de pr&egrave;s !</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pour s&rsquo;en procurer, c&rsquo;est possible directement avec leur&nbsp;<a href="http://danslesac.co/" target="_blank">boutique</a>&nbsp;en ligne ou chez l&rsquo;un des d&eacute;taillants partenaires.</p>\r\n\r\n<p><br />\r\n<img alt="" height="468" src="https://www.alternateeve.com/upload/redactor_upload_images/1504060012_18767229_10213334955627855_62947741_o%20(1).jpg" title="" width="624" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '<p>Avec l&rsquo;ouverture r&eacute;cente d&rsquo;&eacute;piceries z&eacute;ro d&eacute;chet &agrave; Montr&eacute;al, on constate un int&eacute;r&ecirc;t au quotidien pour l&rsquo;&eacute;cologie et l&rsquo;anti-gaspillage. Faire ses courses en vrac? &Ccedil;a nous tente, mais &ccedil;a demande quand m&ecirc;me un peu d&rsquo;organisation. &Agrave; ce sujet, on &nbsp;a d&eacute;couvert Dans le sac, une jeune entreprise montr&eacute;alaise qui a eu l&rsquo;id&eacute;e de sacs en coton r&eacute;utilisables. Vraiment pratique pour faire son &eacute;picerie vrac sans prise de t&ecirc;te!</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="227" src="https://static.wixstatic.com/media/97fca0_ebe2da736a00433080739bf8f615ee86~mv2.png/v1/fill/w_202,h_185,al_c,usm_0.66_1.00_0.01/97fca0_ebe2da736a00433080739bf8f615ee86~mv2.png" style="float:right" title="" width="248" /></p>\r\n\r\n<h4>Comment &ccedil;a a commenc&eacute;.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>C&rsquo;est en s&rsquo;int&eacute;ressant au mouvement z&eacute;ro d&eacute;chet que St&eacute;phanie et Laurie, qui vont souvent&nbsp;acheter du pain en boulangerie, commencent &agrave; utiliser une taie d&rsquo;oreiller pour &eacute;viter l&rsquo;usage d&rsquo;un nouveau sac &agrave; chaque fois. Elles se rendent compte qu&rsquo;il y a un r&eacute;el besoin et cherchent une solution plus esth&eacute;tique. Les deux amies d&eacute;cident alors de coudre leurs propres sacs &agrave; pain r&eacute;utilisables en coton. C&rsquo;est rapidement un succ&egrave;s et les premiers sacs se vendent en quelques jours. Dans le sac est n&eacute;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h4>Dans le sac propose un collection de sacs r&eacute;utilisables 100% coton fabriqu&eacute;s &agrave; Montr&eacute;al.</h4>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" height="221" src="https://static.wixstatic.com/media/97fca0_5928cb00775a4294b5b29ec00e21a3af~mv2.png/v1/fill/w_183,h_183,al_c,usm_0.66_1.00_0.01/97fca0_5928cb00