ntréal, on constate un intérêt au quotidien pour l’écologie et l’anti-gaspillage. Faire ses courses en vrac? Ça nous tente, mais ça demande quand même un peu d’organisation. À ce sujet, on  a découvert Dans le sac, une jeune entreprise montréalaise qui a eu l’idée de sacs en coton réutilisables.', 'Avec l’ouverture récente d’épiceries zéro déchet à Montréal, on constate un intérêt au quotidien pour l’écologie et l’anti-gaspillage. Faire ses courses en vrac? Ça nous tente, mais ça demande quand même un peu d’organisation. À ce sujet, on  a découvert Dans le sac, une jeune entreprise montréalaise qui a eu l’idée de sacs en coton réutilisables.', 'Dans le sac zero dechets ecologie', 'Dans le sac zero dechets ecologie', 'Dans le sac', 'Dans le sac', 'Avec l’ouverture récente d’épiceries zéro déchet à Montréal, on constate un intérêt au quotidien pour l’écologie et l’anti-gaspillage. Faire ses courses en vrac? Ça nous tente, mais ça demande quand même un peu d’organisation. À ce sujet, on  a découvert Dans le sac, une jeune entreprise montréalaise qui a eu l’idée de sacs en coton réutilisables.', 'Avec l’ouverture récente d’épiceries zéro déchet à Montréal, on constate un intérêt au quotidien pour l’écologie et l’anti-gaspillage. Faire ses courses en vrac? Ça nous tente, mais ça demande quand même un peu d’organisation. À ce sujet, on  a découvert Dans le sac, une jeune entreprise montréalaise qui a eu l’idée de sacs en coton réutilisables.', '2017-08-30 11:19:51', '2017-12-15 00:48:49', '2017-08-01');
