INSERT INTO `page_translation` (`page_translation_id`, `page_id`, `page_title`, `content_heading`, `content`, `meta_title`, `meta_description`, `meta_keywords`, `og_title`, `og_description`, `language_id`) VALUES
	(1, 1, 'How it work', 'How it work', '<p>How it work page</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Bacon ipsum dolor amet doner pork belly turducken salami. Filet mignon ham hock turducken boudin shoulder corned beef pastrami frankfurter bacon leberkas flank beef ribs beef brisket. Meatloaf tongue fatback beef ribs ground round meatball sirloin pork belly. Shank brisket meatball strip steak bresaola prosciutto turducken, frankfurter salami ribeye ham hock filet mignon. Ground round spare ribs short ribs, biltong shoulder chuck ham andouille. Tongue ball tip filet mignon, leberkas pork chop bresaola meatball flank tail shoulder porchetta swine.</p>\r\n\r\n<p>Pancetta bacon capicola, filet mignon sirloin pig prosciutto tail swine turducken alcatra ribeye. Filet mignon tongue turkey, leberkas porchetta salami burgdoggen pork loin strip steak alcatra chuck shankle</p>\r\n\r\n<p><span style="font-size:12px"><img alt="canada" height="158" src="http://139.59.68.192/alternateeve/public/upload/redactor_upload_images/1500312375_Flag_of_Canada_(Pantone).jpg" title="canada" width="316" /></span></p>\r\n\r\n<p>prosciutto. Boudin venison filet mignon short loin chuck shank jerky andouille ribeye. Jerky bacon alcatra meatloaf andouille tenderloin, prosciutto shankle. Bacon chicken fatback venison, flank filet mignon pork belly spare ribs shoulder chuck alcatra jerky meatloaf tri-tip meatball.</p>\r\n\r\n<p>Pig porchetta sirloin t-bone corned beef fatback. Cupim picanha pig burgdoggen. Shankle beef short ribs, shank short loin venison leberkas jowl tenderloin alcatra andouille. Pork chop tail sausage, meatloaf jowl shank tenderloin leberkas rump cupim short loin capicola frankfurter turducken.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="c\'est l\'apéro" height="425" src="http://139.59.68.192/alternateeve/public/upload/redactor_upload_images/1500248773_19399298_10155518750503130_1183290084116385214_n.jpg" title="c\'est l\'apéro" width="314" /></p>\r\n\r\n<p>extincteur au ricard jaune sur un mur rouge</p>\r\n\r\n<p>Meatloaf brisket chicken landjaeger hamburger salami turkey ribeye doner andouille. Bacon leberkas spare ribs alcatra. Pastrami pork flank shank, chuck biltong pork chop porchetta kielbasa landjaeger shoulder sausage boudin brisket jerky. Tri-tip bresaola pork chop drumstick. Ground round pancetta bresaola, pork chop swine turkey tongue leberkas jowl tail turducken chicken pork loin. Salami picanha drumstick pastrami bresaola fatback beef ribs tri-tip venison burgdoggen turkey flank hamburger pork loin. Alcatra doner andouille, shank ham hock pork belly swine burgdoggen.</p>\r\n\r\n<p>Doner andouille pork belly t-bone, ribeye cupim meatball kevin pig tongue chuck swine burgdoggen short ribs. Pork porchetta salami t-bone pork loin, meatball pork belly cow pancetta shank. Spare ribs turducken pork short ribs pork loin fatback tail brisket. Shoulder pork chop beef ribs shankle bresaola pork loin pastrami. T-bone sausage leberkas drumstick hamburger ball tip burgdoggen. Tongue alcatra spare ribs, bacon shankle kevin beef tenderloin burgdoggen pig pork loin salami. Bacon chuck turkey ground round.</p>\r\n\r\n<p>Picanha shankle leberkas tail corned beef, pork loin pancetta jowl ham pork boudin jerky beef ribs. Porchetta doner picanha hamburger pork biltong rump shoulder jowl pastrami jerky salami filet mignon kielbasa tenderloin. Filet mignon swine sirloin meatloaf. Ground round meatloaf bresaola spare ribs hamburger porchetta turkey.</p>\r\n\r\n<p>Short ribs tenderloin frankfurter salami, pork belly andouille alcatra filet mignon short loin ground round biltong venison ham hock capicola. Jowl capicola tongue jerky, strip steak flank tail ground round drumstick. Tri-tip chuck chicken turkey. Tri-tip prosciutto t-bone sausage strip steak drumstick. Ham flank leberkas kielbasa, burgdoggen chicken sirloin boudin turducken pork belly shankle. Kielbasa flank leberkas doner strip steak prosciutto jowl spare ribs landjaeger picanha. Jowl brisket burgdoggen andouille beef.</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 1),
	(2, 1, 'Fonctionnement', 'Fonctionnement', '<p style="margin-left:0cm; margin-right:0cm">&nbsp;</p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Acheter localement et moins cher sur Alternateeve est plut&ocirc;t simple. </span></span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Vous avez deux options :</span></span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm">&nbsp;</p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><strong><span style="font-size:14.0pt">Vous pouvez utiliser notre catalogue de produits en ligne. </span></strong></span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Nous avons r&eacute;pertori&eacute; et class&eacute; pour vous des milliers de produits que vous pourrez trouver chez un commer&ccedil;ant local au prix le plus bas de l&#39;internet. </span></span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm">&nbsp;</p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><strong><span style="font-size:14.0pt">Vous savez pr&eacute;cis&eacute;ment ce que vous voulez mais il n&#39;est pas dans notre catalogue ?</span></strong> </span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Parfait, nous pouvons le trouver ! </span></span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Allez dans la section &quot;Demander un produit&quot;. Entrez le nom du produit dans la barre de recherche et nous nous chargeons de vous le trouver chez un commer&ccedil;ant pr&egrave;s de chez vous au prix le moins cher du web. </span></span></span></p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm">&nbsp;</p>\r\n\r\n<p style="margin-left:0cm; margin-right:0cm"><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><strong><span style="font-size:14.0pt">Simplement&nbsp;</span></strong><span style="font-size:14.0pt">:</span></span></span></p>\r\n\r\n<ul style="list-style-type:disc; margin-left:40px">\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">S&eacute;lectionnez votre item</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">D&eacute;terminez la zone g&eacute;ographique de recherche</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Ajoutez&nbsp;&agrave; votre panier (Uniquement si vous utilisez le catalogue)</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Validez votre commande</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Recevez la r&eacute;ponse des commer&ccedil;ants</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Choisissez un magasin</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Imprimer le coupon</span></span></span></li>\r\n	<li><span style="font-size:11pt"><span style="font-family:Calibri,sans-serif"><span style="font-size:10.0pt">Donnez-le au commer&ccedil;ant en r&eacute;cup&eacute;rant votre achat. </span></span></span></li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, 2),
